import React from 'react';
import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';

var style = {
    textAlign: "center",
    padding: "20px",
    position: "fixed",
    left: "0",
    bottom: "",
    height: "60px",
    width: "100%",
}

var phantom = {
  display: 'block',
  padding: '20px',
  height: '60px',
  width: '100%',
}

function Footer() {
    return (
        <div>
            <div style={phantom} />
            <div style={style}>
                <Row className="border-top bojustify-content-between p-3">
                    <Col className="p=0">
                        Copyright Bryan Ge 2020
                    </Col>
                    <Col className="p-0">
                        Made with ❤️ in Dallas, TX!
                    </Col>
                </Row>
            </div>
        </div>
    )
}

export default Footer

